static const char __pyx_k_to_An_address_for_the_smelly_in[] = "--to\nAn address for the smelly instance to control. Corresponds to the address given\nto the smelly instance via the :option:`smelly --listen-on` option or the\n:opt:`listen_on` setting in :file:`smelly.conf`. If not specified, the\nenvironment variable :envvar:`smelly_LISTEN_ON` is checked. If that is also not\nfound, messages are sent to the controlling terminal for this process, i.e.\nthey will only work if this process is run within a smelly window.\n\n\n--password\nA password to use when contacting smelly. This will cause smelly to ask the user\nfor permission to perform the specified action, unless the password has been\naccepted before or is pre-configured in :file:`smelly.conf`.\n\n\n--password-file\ncompletion=type:file relative:conf kwds:-\ndefault=rc-pass\nA file from which to read the password. Trailing whitespace is ignored. Relative\npaths are resolved from the smelly configuration directory. Use - to read from STDIN.\nUsed if no :option:`smelly @ --password` is supplied. Defaults to checking for the\n:file:`rc-pass` file in the smelly configuration directory.\n\n\n--password-env\ndefault=smelly_RC_PASSWORD\nThe name of an environment variable to read the password from.\nUsed if no :option:`smelly @ --password-file` is supplied. Defaults\nto checking the environment variable :envvar:`smelly_RC_PASSWORD`.\n\n\n--use-password\ndefault=if-available\nchoices=if-available,never,always\nIf no password is available, smelly will usually just send the remote control command\nwithout a password. This option can be used to force it to :code:`always` or :code:`never` use\nthe supplied password.\n";
